- input: "TEXT\x1CC00143743\x1C1\x1C\x1CF3XA\x1CLine 21b reports reimbursements for
    travel expenses which are not itemized because they do not exceed the 200 dollar
    itemization level and do not exceed the 200 dollar aggregate per vendor amount.
    \ With respect to the expenditures made by the Party for payroll, payroll taxes,
    and other payroll or employee benefit-related expenses, the Party adheres to 11
    CFR 300.33, and also follows the Commissions revision of the rules as adopted
    on December 1, 2005. Specifically, the Party pays for these costs with 100 percent
    federal funds when the employee spends more than 25 percent of his or her time
    in a month on federal election activity FEA or activity in connection with a federal
    election. These expenditures are reported on Schedule B for Line 30b.  Alternatively,
    when an employee does not meet the 25 percent threshold, the Party allocates these
    costs as an overhead/administrative expense, and reports these disbursements on
    a Schedule H4 for Line 21a.  Transfers from federal to non-federal accounts were
    made for cash flow purposes unless otherwise disclosed. These funds do not represent
    a reimbursement of funds to the non-federal account for disbursements made to
    influence the election or defeat of federal candidates.  Schedule B, Line 29 reflects
    disbursement in the amount of $3,533.38 to Strategic Fundraising for Tele Town-Hall
    Calls that benefit the following non-federal candidates in the amount of $235.42
    each, Dianne Williams, Mike Anderson, John Coselli, Russell Lloyd, Lamar McCorkle,
    Elizabeth Ray, Ryan Patrick, Debra Mayfield, Tad Halbach, Ken Wise, Mike Sullivan,
    Robert Talton, Sarah Davis, David Pineda, and Louis Guthrie in the amount of $237.50.
    \ Schedule B, Line 29 reflects a disbursement to Thomas Graphics in the amount
    of $1,612.93 for postage, design and printing of GOTV mailer for Sarah Davis Campaign
    for State Representative.   Line 30B reflects reimbursed expenses paid to Tom
    Mechler in the amounts of $2,125. 10 and $3055.56 for party advertising paid to
    the following, $625 to The News Gram (Eagle Pass), $855 to Del Reio News Herald,
    $ 413.10 to The Uvalde Leader-News, $232 to the Fort Stockton Pioneer, $350 to
    Progress Times (Mission), $1272 to The Monitor (McAllen), $375 to Cornerstone
    Publications, Inc. (Castroville), $345.56 to Southside Reporter (San Antonio),
    and $500 to La Prensa (San Antonio).\n"
